#include <vector>
#include <string.h>
#include <algorithm>
#include <iostream>

using namespace std;

class Solution {
public:
    vector<int> findAnagrams(string s, string p) {
    
        vector<int> out_index;
        
        if(s.length() < p.length())
            return out_index;
        
		do{
			for(int i = 0; i <= s.length() - p.length(); i++){
				int x = 0;
				while( (s[i] == p[x]) && (p[x] != '\0') ){
					x++; i++;
				}
				if(x == p.length() ){
					out_index.push_back(i - x);
					i -= p.length();
				}
				else
					i -= x;
			}
		} while( next_permutation(p.begin(), p.end()) );
				
    return out_index;
	}
};
	
int main(int argc, char** argv)
{
	Solution s;
	string str = {""};
	string p = {"yqrbgjdwtcaxzsnifvhmou"};
	
	vector<int>out = s.findAnagrams(str, p);
	
	for(auto x: out)
		cout<<x<<" ";
	
return 0;
}

